script: |
  super -f tsv -I q745.sql | sort > q745.out

vector: true

inputs:
  - name: q745.sql
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab2 AS cor0 WHERE cor0.col2 * col1 * col2 NOT IN ( col0 / + col1 + + col0 * - col1 ) OR NULL >= ( - col1 );
  - name: tab2

outputs:
  - name: q745.out
    data: |
      -26
      -27
      -38
